//twitter.com/GovMurphy/status/1379145360858349570?s=20","id":"avis-byfield"},{"name_display":"Eva Byfield","name_sort":"Byfield, Eva","county":"Morris","age":"32","photo_optional":"","profile_link":"","obit_link":"https://obits.nj.com/obituaries/starledger/obituary.aspx?n=avis-m-and-eva-a-byfield&pid=197525676&fhid=6054","other_link":"https://twitter.com/GovMurphy/status/1379145360858349570?s=20","id":"eva-byfield"},{"name_display":"Nicholas Cannizzaro","name_sort":"Cannizzaro, Nicholas","county":"Morris","age":"81","photo_optional":"","profile_link":"https://www.northjersey.com/story/news/coronavirus/2021/06/03/covid-nj-nicholas-cannizzaro-drove-miles-support-his-family/5045715001/","obit_link":"https://vandermay.com/obituarydetail.html#/20435","other_link":"","blurb_optional":"\u201cLoved Life, Family and the American Dream: The Story of Nicholas Cannizzaro\u201d Nick was born in Carlstadt, New Jersey, in 1939, a time when families were struggling to make ends meet. He was the 3rd child of Nicholas and Hazel Cannizzaro. Nick didn\u2019t have much schooling as his family moved from one place to another and for a while he lived with his maternal grandmother. He started work at a very young age, which was a common thing you saw for the times. At 17, he was walking along Market Street in Paterson and turned into the recruiting office to sign up for the Army. He radiated patriotism and had this new sense of pride. However, as fate would have it, he was discharged honorably at the request of his mother. Nick was needed at home to help support her and his four half brothers. He came home with the same love for the American Dream and drove trucks for a couple different companies until retirement; which he enjoyed. He supported his family without missing a beat, until fate stepped in once again. Janet entered his life and left her mark on his heart, forever. His first and only love, they married the following year as teenagers and made their way together in a small apartment in Paterson. They worked hard and bought their first home after their third child was born. A year later, they bought their second home that had a huge yard with a fence; this was a huge deal as Nick dreamed of owning a house with a yard this big. Their four children were raised in this home. Watching them play outside in their backyard with a pool and a dog, that pride he felt at 17 years old welcomed its way back into Nick\u2019s life. He made sure to find some time to go fishing and hunting with his sons and to help out in the house from simple repairs to running the lawn mower. He wanted to show his family about the ties that bind a family. Nick worked hard his entire life, no complaints. So when he retired he finally had more time for himself and his family.","id":"nicholas-cannizzaro"},{"name_display":"Gerald Carlson","name_sort":"Carlson, Gerald","county":"Morris","age":"87","photo_optional":"","profile_link":"https://www.northjersey.com/story/news/2020/04/08/nj-coronavirus-father-dies-alone-nursing-home-unable-see-son/2958748001/","id":"gerald-carlson"},{"name_display":"James Casapulla","name_sort":"Casapulla, James","county":"Morris","age":"85","photo_optional":"","profile_link":"","obit_link":"https://www.browningforshay.com/obituaries/Deacon-James-M-Casapulla?obId=19543696","other_link":"","blurb_optional":"My father was a veteran, a pharmacist, a deacon in the Catholic Church , a grandpa, a great grandpa but most of all, a father who taught me how to live and love. He will be greatly missed by all who knew him. ","id":"james-casapulla"},{"name_display":"Vincent Chirico","name_sort":"Chirico, Vincent","county":"Morris","age":"","photo_optional":"https://lovedandlostnj.com/wp-content/uploads/sites/10/2021/04/Vincent-Chirico.jpeg","profile_link":"https://www.dailyrecord.com/story/news/2021/06/01/covid-nj-vincent-chirico-madison-police-chief-coach-golfer/5034653001/","obit_link":"https://madisonmemorialhome.com/tribute/details/753/Vincent-D-Chirico/obitu